import React from "react";
import { Box, Typography, Button, Grid } from "@mui/material";

export default function NoTours({ fetchTours }) {
  return (
    <Grid container sx={{
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        textAlign: "center",
        width: "100vw",
        height: "100vh",

    }}
    spacing={1}>
      <Grid item xs={12}>
        <Typography
          variant="h2"
          sx={{
            display: "inline",
            textDecoration: "underline hsl(205, 78%, 60%)",
          }}
        >
          No tours left
        </Typography>
      </Grid>
      <Grid item xs={4}>
      <Button
        sx={{
          color: "hsl(360, 67%, 44%)",
          width: "60%",
          textTransform: "none",
          fontWeight: "bold",
          backgroundColor: "white",

          marginTop: 2,
          borderColor: "hsl(360, 67%, 44%)",
          "&:hover": {
            backgroundColor: "#CF7095",
          },
        }}
        variant="outlined"
        onClick={fetchTours}
      >
        Refresh
      </Button>
      </Grid>
    </Grid>
  );
}
